import{O as e,p as t,u as n}from"./chunks/runtime-core.esm-bundler.C4SeSNkW.js";import{t as r}from"./chunks/plugin-vue_export-helper.CX9MnrDp.js";const i=JSON.parse(`{"title":"Getting Started","description":"","frontmatter":{"title":"Getting Started","outline":"deep","head":[["meta",{"property":"og:title","content":"Getting Started"}],["meta",{"name":"twitter:title","content":"Getting Started"}],["meta",{"property":"og:description","content":"A collection of high-performance JavaScript tools written in Rust"}],["meta",{"name":"twitter:description","content":"A collection of high-performance JavaScript tools written in Rust"}],["meta",{"property":"og:url","content":"https://oxc.rs/docs/contribute/development.html"}]]},"headers":[],"relativePath":"docs/contribute/development.md","filePath":"docs/contribute/development.md"}`);var a={name:`docs/contribute/development.md`};function o(r,i,a,o,s,c){return e(),n(`div`,null,[...i[0]||=[t(`<div style="display:none;" hidden="true" aria-hidden="true">Are you an LLM? You can read better optimized documentation at /docs/contribute/development.md for this page in Markdown format</div><h1 id="getting-started" tabindex="-1">Getting Started <a class="header-anchor" href="#getting-started" aria-label="Permalink to “Getting Started”">​</a></h1><h2 id="clone-repository" tabindex="-1">Clone Repository <a class="header-anchor" href="#clone-repository" aria-label="Permalink to “Clone Repository”">​</a></h2><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> clone</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -c</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> core.longpaths=</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">true</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> git@github.com:oxc-project/oxc.git</span></span></code></pre></div><h2 id="set-up-project" tabindex="-1">Set Up Project <a class="header-anchor" href="#set-up-project" aria-label="Permalink to “Set Up Project”">​</a></h2><h3 id="install-rust" tabindex="-1">Install Rust <a class="header-anchor" href="#install-rust" aria-label="Permalink to “Install Rust”">​</a></h3><p>If you have not yet installed Rust, follow <a href="https://www.rust-lang.org/tools/install" target="_blank" rel="noreferrer">the official instruction</a> and install Rust.</p><p>After installing Rust, run the following command on the project root:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rustup</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> show</span></span></code></pre></div><p><code>rustup show</code> reads the <code>./rust-toolchain.toml</code> file and installs the correct Rust toolchain and components for this project.</p><h3 id="cargo-binstall" tabindex="-1"><code>cargo binstall</code> <a class="header-anchor" href="#cargo-binstall" aria-label="Permalink to “cargo binstall”">​</a></h3><p>Some Cargo tools are required to develop OXC, and it is recommended to use <a href="https://github.com/cargo-bins/cargo-binstall" target="_blank" rel="noreferrer">cargo binstall</a>, which provides a low-complexity mechanism to install rust binaries and is faster way than building them from source by running <code>cargo install</code>.</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">cargo</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> cargo-binstall</span></span></code></pre></div><p>You can also download <a href="https://github.com/cargo-bins/cargo-binstall#installation" target="_blank" rel="noreferrer">the pre-compiled binary</a> and save it in <code>~/.cargo/bin</code>.</p><h3 id="just" tabindex="-1"><code>just</code> <a class="header-anchor" href="#just" aria-label="Permalink to “just”">​</a></h3><p>OXC utilizes <a href="https://github.com/casey/just" target="_blank" rel="noreferrer"><code>just</code></a>, which is a handy way to save and run project-specific commands:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">cargo</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> binstall</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> just</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -y</span></span></code></pre></div><h3 id="install-cmake" tabindex="-1">Install CMake <a class="header-anchor" href="#install-cmake" aria-label="Permalink to “Install CMake”">​</a></h3><p>Install CMake by downloading from the official <a href="https://cmake.org/download/" target="_blank" rel="noreferrer">website</a>.</p><p><a href="https://brew.sh/" target="_blank" rel="noreferrer">Homebrew</a> users can alternatively install with:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">brew</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> cmake</span></span></code></pre></div><h3 id="install-pnpm" tabindex="-1">Install pnpm <a class="header-anchor" href="#install-pnpm" aria-label="Permalink to “Install pnpm”">​</a></h3><p>Install <code>pnpm</code> (a package manager for node.js, similar to <code>npm</code>) by following instructions from the official <a href="https://pnpm.io/installation" target="_blank" rel="noreferrer">website</a>.</p><h4 id="dependencies" tabindex="-1">Dependencies <a class="header-anchor" href="#dependencies" aria-label="Permalink to “Dependencies”">​</a></h4><p>Run the following command in <code>justfile</code> at the project root to install dependencies:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">just</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> init</span></span></code></pre></div><p>You can see the list of available commands by running <code>just</code>.</p><p>You can run <code>just ready</code> (or, <code>just r</code> in short) to make sure the whole project builds and runs correctly.</p><h2 id="macos-faster-compilation" tabindex="-1">macOS: Faster Compilation <a class="header-anchor" href="#macos-faster-compilation" aria-label="Permalink to “macOS: Faster Compilation”">​</a></h2><p>macOS has an antivirus feature called XProtect that scans executables for malware on first run. This can significantly slow down Rust builds, especially build scripts and test executables. You can speed up compilation by adding Terminal as a &quot;developer tool&quot; in System Settings:</p><ol><li>Open System Settings &gt; Privacy &amp; Security &gt; Developer Tools</li><li>Add your terminal app (Terminal, iTerm, etc.)</li><li>Restart the terminal app</li></ol><p><strong>Note:</strong> This disables an OS security feature. Only do this if you&#39;re comfortable with the trade-off.</p><p>More details: <a href="https://nnethercote.github.io/2025/09/04/faster-rust-builds-on-mac.html" target="_blank" rel="noreferrer">https://nnethercote.github.io/2025/09/04/faster-rust-builds-on-mac.html</a></p>`,33)]])}var s=r(a,[[`render`,o]]);export{i as __pageData,s as default};